import React from "react";
import {Link} from 'react-router-dom';
import { withAuth } from '@okta/okta-react';

export default withAuth(class ProfileBar extends React.Component {
  constructor() {
    super()
    this.state = {
    };
  }

  render() {
    return (
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">         
            <ul className="navbar-nav mr-auto">
              <li >
              <Link className="nav-link"><b>John Appleseed</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>PA3</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>Male</b></Link>
              </li>
              <li  >
              <Link className="nav-link"><b>25</b></Link>
              </li>
              <li  >
                <Link onClick={this.props.auth.logout('/')} className="nav-link"><b>Logout</b></Link>
              </li>
            </ul>
        </nav>
      </div>
    );
  }
});
